import React, { Component } from 'react'

export class LoginPage extends Component {
    render() {
        return (
            <div>
                <h1>Login</h1>
                <form>
                    <label>
                        Log in to WonderPage!
                        <input type="email" />
                        <br />
                        <input type="password" />
                        <input type="submit" value="Log in" />
                    </label>
                </form>

            </div>
        )
    }
}

export default LoginPage
